import React from 'react';
import './About.css';
import resumePDF from '../assets/resume.pdf';

function About() {
    return(
        <section className="about">
            <h2>About Me</h2>
            <p className='about-text'>
                I'm a self-taught frontend developer with a strong interest in building clean and interactive web experience
                <br /><br />
                I enjoy turning complex problems into simple, beautiful, and intuitive designs. My background in design and coding allows me to bridge the gap between development and user-friendly interfaces.
                <br /><br />
                Currently, I'm looking for oppotunities to grow as a frontend developer while contributing to impactful projects.
                <br /><br />
            </p>

            <p className='about-purpose'>
                This portfolio acts as a digital resume that not only summarizes my experience but helps potential employers and collaborators understand who I am and what I stand for.
            </p>

            <div className='about-extra'>
                {/* <p>
                    <strong>Interests: </strong>Web Animations, Open Source, Creative coding
                </p> */}
                <p>
                    <strong>Career Goals: </strong>Become a world-class Full Stack Developer and build products that matter.
                </p>
            </div>

            <a href={resumePDF} download className='resume-button'>Download Resume</a>
        </section>
    );
}

export default About;
